DROP TABLE IF EXISTS `bi_pc28`;
CREATE TABLE `bi_pc28` (
  `id` int(8) unsigned NOT NULL AUTO_INCREMENT,
  `open_time` varchar(12) NOT NULL,
  `open_num` varchar(3),
  `all_down` int(6) unsigned NOT NULL,
  `all_eggs` int(12) unsigned not null,
  `open_people` int(5) unsigned not null,
  `bets_rate` varchar(180) not null,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;
